import React from 'react';
import Landing from './pages/landing/landing';
import CreateTalent from './pages/createTalent/createTalent';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import './App.sass';


var App = () => {

  return (
    <Router>
    <Switch>
          <Route path="/" exact component={Landing}/>
          <Route path="/create_talent" exact component={CreateTalent}/>
          <Route path="/sign_up" exact component={CreateTalent}/>
          <Route path="/about" exact component={CreateTalent}/>
          <Route path="/pricing" exact component={CreateTalent}/>
          <Route path="/login" exact component={CreateTalent}/>
        </Switch>
    </Router>
  );
}

export default App;
